36,1337,1338,1339,1340,1341,1342,1343,1344,1345,1346,1347,1348,1349,1350,1351,1352,1353,1354,1355,1356,1357,1358,1359,1360,1361,1362,1363,1364,1365,1366,1367,1368,1369,1370,1371,1372,1373,1374,1375,1376,1377,1378,1379,1380,1381,1382,1383,1384,1385,1386,1387,1388,1389,1390,1391,1392,1393,1394,1395,1396,1397,1398,1399,1400,1401,1402,1403,1404,1405,1406,1407,1408,1409,1410,1411,1412,1413,1414,1415,1416,1417,1418,1419,1420]},"selected":{"id":"2969"},"selection_policy":{"id":"2970"}},"id":"2917","type":"ColumnDataSource"},{"attributes":{},"id":"3380","type":"Selection"},{"attributes":{"aspect_ratio":5.0,"below":[{"id":"2928"}],"center":[{"id":"2931"},{"id":"2935"},{"id":"2971"}],"js_event_callbacks":{"mouseleave":[{"id":"3400"}],"mousemove":[{"id":"3399"}]},"left":[{"id":"2932"}],"plot_width":1000,"renderers":[{"id":"2959"},{"id":"2976"}],"sizing_mode":"scale_width","title":{"id":"2946"},"toolbar":{"id":"2941"},"toolbar_location":null,"x_range":{"id":"2920"},"x_scale":{"id":"2924"},"y_range":{"id":"2922"},"y_scale":{"id":"2926"}},"id":"2919","subtype":"Figure","type":"Plot"},{"attributes":{"toolbar":{"id":"3492"},"toolbar_location":"above"},"id":"3493","type":"ToolbarBox"},{"attributes":{},"id":"2929","type":"BasicTicker"},{"attributes":{},"id":"3381","type":"UnionRenderers"},{"attributes":{"text":"Broker (None)","text_color":{"value":"#333333"}},"id":"2946","type":"Title"},{"attributes":{"children":[{"id":"3494"}],"sizing_mode":"stretch_width"},"id":"3496","type":"Row"},{"attributes":{},"id":"2924","type":"LinearScale"},{"attributes":{"sizing_mode":"scale_both","text":"class TestStrategy(bt.Strategy):\n    params = (('p1', 8), \n    ('p2', 21),\n    ('p3', 55),\n    ('p4', 144),\n    ('rsi', 40),\n    ('rr', 2),\n    ('rrp', 1),\n    ('candleper', 0.005),\n    ('delay', -1),\n    ('pricelimitper', 0.001),\n    ('bodyper', 0.7),\n    )\n    \n\n    def log(self, txt, dt=None):\n        ''' Logging function fot this strategy'''\n        dt = dt or self.datas[0].datetime.date(0)\n        #print('%s, %s' % (dt.isoformat(), txt))\n        print('%s,%s, %s' % (dt.strftime(\"%d/%m/%Y\"),self.datas[0].datetime.time().strftime(\"%H:%M:%S\") ,txt))\n\n    def __init__(self):\n        # Keep a reference to the \"close\" line in the data[0] dataseries\n        self.dataclose = self.datas[0].close\n        self.dataopen = self.datas[0].open\n        self.datalow = self.datas[0].low\n        self.datahigh = self.datas[0].high\n        \n\n        # To keep track of pending orders and buy price/commission\n        self.order = None\n        self.buyprice = None\n        self.buycomm = None\n        self.sl = 1\n        self.reward = 0\n        \n\n        # Add a MovingAverageSimple indicator\n        self.sma1 = bt.indicators.EMA(period=self.p.p1)\n        self.sma2 = bt.indicators.EMA(period=self.p.p2)\n        self.sma3 = bt.indicators.EMA(period=self.p.p3)\n        self.sma4 = bt.indicators.EMA(period=self.p.p4)\n        self.rsi = bt.indicators.RSI(self.datas[0],plothlines=[55, 45])\n        #self.vwap = bt.indicators.VWAP(self.datas[0])\n\n    def notify_order(self, order):\n        if order.status in [order.Submitted, order.Accepted]:\n            # Buy/Sell order submitted/accepted to/by broker - Nothing to do\n            return\n\n        # Check if an order has been completed\n        # Attention: broker could reject order if not enough cash\n        if order.status in [order.Completed]:\n            if order.isbuy():\n                self.log(\n                    'BUY EXECUTED, Price: %.2f, Cost: %.2f, Comm %.2f, candle_pos = %.2f,' %\n                    (order.executed.price,\n                     order.executed.value,\n                     order.executed.comm,\n                     len(self)))\n\n                self.buyprice = order.executed.price\n                self.buycomm = order.executed.comm\n            else:  # Sell\n                self.log('SELL EXECUTED, Price: %.2f, Cost: %.2f, Comm %.2f  candle_pos =%.2f,' %\n                         (order.executed.price,\n                          order.executed.value,\n                          order.executed.comm,\n                          len(self)))\n\n            self.bar_executed = len(self)\n\n        elif order.status in [order.Canceled, order.Margin, order.Rejected]:\n            self.log('Order Canceled/Margin/Rejected')\n\n        self.order = None\n\n    def notify_trade(self, trade):\n        if not trade.isclosed:\n            return\n\n        self.log('OPERATION PROFIT, GROSS %.2f, NET %.2f \\n \\n' %\n                 (trade.pnl, trade.pnlcomm))\n        \n\n\n    def next(self):\n        # Simply log the closing price of the series from the reference\n        #self.log('Close, %.2f' % self.dataclose[0])\n        # Check if time is greater 9 30 or not\n        \n        if (self.data.datetime.time() &lt; datetime.time(9,30) ) or (self.data.datetime.time() &gt; datetime.time(15,10)) :\n                return \n\n        # Check if an order is pending ... if yes, we cannot send a 2nd one\n        if self.order:\n            return\n        \n\n            # Check if we are in the market\n        if self.position.size == 0:\n            \n            # Not yet ... we MIGHT BUY if ... self.datas[0].close\n            c1 = (self.dataclose[self.p.delay] &gt; self.dataopen[self.p.delay]) # Green Candle \n            c2 = (self.rsi[self.p.delay] &gt;= self.p.rsi)  # RSI&gt;55 \n            c3 = (self.dataclose[self.p.delay] &gt; self.sma1[self.p.delay]) &amp; (self.dataclose[self.p.delay] &gt; self.sma2[self.p.delay]) # Close above EMA1  and 2\n            c4 = (self.datalow[self.p.delay] &lt; self.sma1[self.p.delay]) &amp; (self.datalow[self.p.delay] &lt; self.sma2[self.p.delay])  #low below 9 and 21 ema\n            c5 = ((self.datahigh[self.p.delay]-self.datalow[self.p.delay]) &lt; self.p.candleper * self.dataclose[self.p.delay]) #  hi-low &lt; 0.5% of close\n            c6 = self.dataclose[self.p.delay] &gt; self.sma3[self.p.delay]\n            c7 = self.dataclose[self.p.delay] &gt; self.sma4[self.p.delay]\n            #c8 = self.dataclose[0] &gt; self.vwap[0]\n            c9 = (self.dataclose[self.p.delay]-self.dataopen[self.p.delay]) &gt; self.p.bodyper * (self.datahigh[self.p.delay] - self.datalow[self.p.delay])\n            testcandle = 3110\n            if(len(self) == testcandle):\n                self.log(\"Entering candle no \" + str(testcandle))\n                                                                                                                         \n            if (c1 &amp; c2 &amp; c3 &amp; c4 &amp; c5 &amp; c9):\n                ##diff = self.dataclose[0] - self.dataclose[lastred]\n                rr = self.p.rr\n                if(c6):\n                    rr += self.p.rrp\n                if( c7 ):\n                    rr += self.p.rrp\n                # if( c8 ):\n                #     rr+=1\n                #rr =2 \n                cash = self.stats.broker.cash[self.p.delay]\n                maxRisk = cash * 0.01\n                diff = abs(2*(self.datahigh[self.p.delay]-self.datalow[self.p.delay]))\n                self.sl = self.dataclose[self.p.delay] - diff\n                self.reward = rr*diff+self.dataclose[self.p.delay]\n                self.bsize = int(min(maxRisk/diff , cash/self.dataclose[self.p.delay]))\n                # BUY, BUY, BUY!!! (with all possible default parameters)\n                bprice = self.data.close[self.p.delay] * (1+self.p.pricelimitper)\n                self.log(\" Buy Signal at candle_pos = \"+str(len(self))+ \" Buy limit at \"+ str(bprice))\n\n                \n\n                # Keep track of the created order to avoid a 2nd order\n                #self.order = self.buy(size=self.bsize)\n                \n                self.order = self.buy(exectype=bt.Order.Stop,\n                size=self.bsize,price=bprice,\n                valid=datetime.datetime.now() + datetime.timedelta(minutes=30)\n                )\n\n                self.log('BUY CREATE, %.2f' % self.dataclose[self.p.delay])\n\n        else:\n            # Already in a position? check exit criteria\n\n            # Long Eixt criteria\n            e1 = (self.dataclose[0] &lt; self.sl) # SL reached\n            e2 = (self.dataclose[0] &gt; self.reward) # Reward reached\n            e3 = (self.dataopen[0] &gt; self.reward)  # Reward reached \n\n            if (e1 | e2 | e3):\n                # SELL, SELL, SELL!!! (with all possible default parameters)\n                self.log('SELL CREATE... closed position, %.2f ' % self.dataclose[0])\n\n                # Keep track of the created order to avoid a 2nd order\n                self.order = self.sell(size=self.bsize)\n        #printf(f) Close all positions EOD\n        if self.position.size != 0:\n            if self.data.datetime.time() &gt; datetime.time(15,10):\n                    self.close(exectype=bt.Order.Market,size=self.position.size)\n"},"id":"3645","type":"PreText"},{"attributes":{"css_classes":["panel-title"],"sizing_mode":"scale_both","text":"Source Code"},"id":"3644","type":"Paragraph"},{"attributes":{"use_scientific":false},"id":"2947","type":"BasicTickFormatter"},{"attributes":{},"id":"2920","type":"DataRange1d"},{"attributes":{"axis_line_color":"#222222","formatter":{"id":"2949"},"major_label_text_color":"#333333","major_tick_line_color":"#222222","minor_tick_line_color":"#222222","ticker":{"id":"2929"}},"id":"2928","type":"LinearAxis"},{"attributes":{"range_padding":0.5,"renderers":[{"id":"2959"},{"id":"2976"}]},"id":"2922","type":"DataRange1d"},{"attributes":{"css_classes":["table-title"],"text":"Strategy: TestStrategy"},"id":"3501","type":"Paragraph"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","top_units":"screen"},"id":"3353","type":"BoxAnnotation"}],"root_ids":["3648"]},"title":"Bokeh Application","version":"2.1.1"}}
        </script>
